import Link from "next/link";

function Index() {
  return (
    <div>
      <ul>
        <li>
          <Link href="/">
            <a>Home</a>
          </Link>
        </li>
        <li>
          <Link href="/about">
            <a>About</a>
          </Link>
        </li>
      </ul>
      <h1>
        <div>Hello Next.js</div>
      </h1>
    </div>
  );
}

export default Index;
